# Binding To leveldb In this exercise, we will create a binding to the leveldb database library. You will learn: How to use raw C bindings (also called "sys"-crates) How to manage and interact with foreign pointers How to use Rusts Ownership system to provide additional guarantees All necessary C functions will be described in this document. Their full interface can be seen in the documentation . ## Setup Create a new cargo library project called "leveldb". Change the "Dependencies" section in Cargo.toml like this: [dependencies]
